import React, { Component } from 'react';
import { Grid } from 'react-bootstrap';

import SubTotal from './CartComponents/SubTotal';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="container">
        <Grid className="purchaseCard">
          <h1>Hello World</h1>
        </Grid>
      </div>
    );
  }
}

export default App;
